/**
 * Genera un JWT de acceso con payload { sub, role }.
 */
export const generateAccessToken = (payload: TokenPayload): string =>
  jwt.sign(
    payload as object,
    PRIVATE_KEY as Secret,
    {
      algorithm: "RS256",
      expiresIn: ACCESS_EXPIRES_IN,
    } as SignOptions
