                showModal={showModal}
                modalType={modalType}
                setFormEmail={setFormEmail}
                setModalStep={setModalStep}
                setShowModal={setShowModal}
                setModalType={setModalType}
              />
            </motion.div>
          </AnimatePresence>
        </motion.div>
      </motion.div>

      <AuthResendModal
        modalStep={modalStep}
        showModal={showModal}
        email={formEmail}
