        {/* Right-side icons */}
        <div className="flex items-center gap-4">
          <ThemeToggle />

          {isLoggedIn ? (
            <Menu as="div" className="relative">
              <MenuButton className="flex items-center space-x-2 focus:outline-none">
                <FaUserCircle className="text-2xl" />
                <div className="text-left">
