import { ReactNode } from "react";
import { Navigate } from "react-router-dom";
import { useAuthStore } from "@/store/useAuthStore";

interface Props {
  children: ReactNode;
  allowedRoles: string[];
}

export default function PrivateRoute({ children, allowedRoles }: Props) {
