            }}
            type="submit"
            className="register-button w-full bg-accent2/80 hover:bg-primary text-white rounded-xl py-3 px-4 font-medium hover:shadow-lg transition-all duration-200"
          >
            Registrar Factura
          </motion.button>
        </div>
      </motion.form>
    </section>
  );
};

