import { useEffect, useRef, useState } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { FaSun, FaMoon, FaUserCircle } from "react-icons/fa";
import { BsList } from "react-icons/bs";
import { motion, AnimatePresence } from "framer-motion";
import { useAuthStore } from "@/store/useAuthStore";
import { useTheme } from "@/hooks/useTheme";
import api from "@/api/axios";
import { isAxiosError } from "axios";

interface HeaderMobileProps {
  isSidebarOpen: boolean;
  onToggle: () => void;
  isMobile: boolean;
}

type Role = "client" | "admin";

export default function HeaderMobile({
  isSidebarOpen,
  onToggle,
  isMobile,
}: HeaderMobileProps) {
  const { darkMode, toggleDarkMode } = useTheme();
  const user = useAuthStore((s) => s.user);
  const logoutStore = useAuthStore((s) => s.logout);
  const navigate = useNavigate();
  const location = useLocation();
  const menuRef = useRef<HTMLDivElement>(null);
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const isLoggedIn = Boolean(user);
  const role: Role = user?.role === "admin" ? "admin" : "client";

  const dropdownItems: Record<Role, { label: string; path: string }[]> = {
    client: [
      { label: "Perfil", path: "/perfil" },
      { label: "Ajustes", path: "/ajustes" },
    ],
    admin: [
      { label: "Home", path: "/" },
      { label: "Dashboard", path: "/admin/dashboard" },
      { label: "Perfil", path: "/perfil" },
    ],
  };

  // Cerrar dropdown al cambiar de ruta
  useEffect(() => {
    setDropdownOpen(false);
  }, [location.pathname]);

  // Cerrar dropdown al click fuera
  useEffect(() => {
    const handleClickOutside = (e: MouseEvent) => {
      if (
        dropdownOpen &&
        menuRef.current &&
        !menuRef.current.contains(e.target as Node)
      ) {
        setDropdownOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => {
      document.removeEventListener("mousedown", handleClickOutside);
    };
  }, [dropdownOpen]);

  const handleLogout = async () => {
    try {
      await api.post("/logout");
    } catch (error: unknown) {
      if (isAxiosError(error)) {
        // 401 = sesi√≥n expirada, no lo tratamos como "error real"
        if (error.response?.status !== 401) {
          console.error("Logout failed:", error);
        }
      } else {
        console.error("Error inesperado al hacer logout:", error);
